import React, {Fragment} from 'react';

export const Componente = () => {
  return (
    <Fragment>
      <div>
        <hr/>
        <h2>Mi primer componente</h2>
        <ul>
          <li>Angular</li>
          <li>React</li>
          <li>Vue</li>
        </ul>
      </div>
    </Fragment>
  )
}

export default Componente;
